import React, { useState, useEffect } from 'react';

function Guestbook() {
  const [posts, setPosts] = useState([])

  useEffect(() => {
    window.scrollTo(0, 0)
  }, [])

  return (
    <div style={{overflow: "scroll" }}>
      <header style={{display: 'flex', flexDirection: 'column', alignItems: 'center'}}>
        <h1 id="title">33chan</h1>
        <p>33chan is an anonymous imageboard where guests can say hello.</p>
        <form style={{maxWidth: "fit-content"}}>
          <input placeholder='Your name...' type="text"></input><br />
          <input placeholder='Subject...' type="text"></input><br />
          <textarea rows={6} cols={28}></textarea>
        </form>
      </header>
      <hr />
    </div>
  );
}

export default Guestbook;
